// Get webhook data from the Webhook1 node (correct way)
const webhookData = $('Webhook1').item.json.body;
const fromDate = webhookData.fromDate || '';
const toDate = webhookData.toDate || '';

// Get all items from previous node (Google Sheets data)
const items = $input.all();

let totalAmount = 0;
let totalExtraCharges = 0;
let grandTotal = 0;
let csvRows = [];

// Function to convert number to words (Indian format)
function numberToWords(num) {
  const a = [
    '', 'One', 'Two', 'Three', 'Four', 'Five', 'Six', 'Seven', 'Eight', 'Nine',
    'Ten', 'Eleven', 'Twelve', 'Thirteen', 'Fourteen', 'Fifteen', 'Sixteen',
    'Seventeen', 'Eighteen', 'Nineteen'
  ];
  const b = ['', '', 'Twenty', 'Thirty', 'Forty', 'Fifty', 'Sixty', 'Seventy', 'Eighty', 'Ninety'];

  function convertLessThanThousand(n) {
    if (n === 0) return '';
    if (n < 20) return a[n];
    if (n < 100) return b[Math.floor(n / 10)] + (n % 10 ? ' ' + a[n % 10] : '');
    return a[Math.floor(n / 100)] + ' Hundred' + (n % 100 ? ' and ' + convertLessThanThousand(n % 100) : '');
  }

  if (num === 0) return 'Zero';

  const [rupees, paise] = num.toFixed(2).split('.').map(Number);
  let words = '';

  if (rupees >= 10000000) {
    words += convertLessThanThousand(Math.floor(rupees / 10000000)) + ' Crore ';
  }

  if (rupees >= 100000) {
    words += convertLessThanThousand(Math.floor((rupees % 10000000) / 100000)) + ' Lakh ';
  }

  if (rupees >= 1000) {
    words += convertLessThanThousand(Math.floor((rupees % 100000) / 1000)) + ' Thousand ';
  }

  const remaining = rupees % 1000;
  if (remaining > 0) {
    words += convertLessThanThousand(remaining);
  }

  words = words.trim() + ' Rupees';

  if (paise > 0) {
    words += ' and ' + convertLessThanThousand(paise) + ' Paise';
  }

  return words + ' Only';
}

// CSV Header
csvRows.push([
  'S.No',
  'Bill Name',
  'Invoice No',
  'Invoice Date',
  'Site',
  'Sub Ledger',
  'GST',
  'Amount',
  'Currency',
  'Amount USD',
  'Amount INR',
  'Payment Method',
  'Extra Charges',
  'Status'
]);

// Process each record from Google Sheets
items.forEach((item, index) => {
  const data = item.json;

  // Calculate amount for this record
  const baseAmount = parseFloat(data.amountINR) || 0;
  const extraCharges = (data.hasExtraCharges && data.chargesAmount) 
    ? parseFloat(data.chargesAmount) 
    : 0;

  const recordAmount = baseAmount + extraCharges;

  // Add to totals
  totalAmount += baseAmount;
  totalExtraCharges += extraCharges;
  grandTotal += recordAmount;

  // Add row to CSV
  csvRows.push([
    index + 1,
    data.billName || '',
    data.invoiceNumber || '',
    data.invoiceDate || '',
    data.site || '',
    data.subLedger || '',
    data.gstNumber || '',
    recordAmount.toFixed(2),
    data.currency || '',
    data.amountUSD || '',
    baseAmount.toFixed(2),
    data.paymentMethod || '',
    extraCharges.toFixed(2),
    data.updated || ''
  ]);
});

// Add empty row
csvRows.push(['', '', '', '', '', '', '', '', '', '', '', '', '', '']);

// Add total row with extra charges total
csvRows.push([
  '',
  '',
  '',
  '',
  '',
  'TOTAL',
  '',
  grandTotal.toFixed(2),
  '',
  '',
  totalAmount.toFixed(2),
  '',
  totalExtraCharges.toFixed(2),
  ''
]);

// Add empty rows
csvRows.push(['', '', '', '', '', '', '', '', '', '', '', '', '', '']);
csvRows.push(['', '', '', '', '', '', '', '', '', '', '', '', '', '']);

// Add amount in words
const amountInWords = numberToWords(grandTotal);
csvRows.push(['', `Amounts in words: ${amountInWords}`, '', '', '', '', '', '', '', '', '', '', '', '']);
csvRows.push(['', '', '', '', '', '', '', '', '', '', '', '', '', '']);
csvRows.push(['', 'Prepared by Bala', '', '', 'Checked by Ayyanar', '', '', 'Approved by Praveen', '', '', '', '', '', '']);

// Convert to CSV string
const csvContent = csvRows.map(row => 
  row.map(cell => {
    const cellStr = String(cell);
    if (cellStr.includes(',') || cellStr.includes('"') || cellStr.includes('\n')) {
      return '"' + cellStr.replace(/"/g, '""') + '"';
    }
    return cellStr;
  }).join(',')
).join('\n');

// Create filename with date range
const fileName = `Reimbursement_Report_${fromDate}_to_${toDate}.csv`;

// Return data for next nodes
return [
  {
    json: {
      csvContent: csvContent,
      fileName: fileName,
      amountInWords: amountInWords,
      summary: {
        totalAmount: totalAmount.toFixed(2),
        totalExtraCharges: totalExtraCharges.toFixed(2),
        grandTotal: grandTotal.toFixed(2),
        recordCount: items.length,
        fromDate: fromDate,
        toDate: toDate
      }
    },
    binary: {
      data: {
        data: Buffer.from(csvContent).toString('base64'),
        mimeType: 'text/csv',
        fileName: fileName
      }
    }
  }
];

// Get the data from the Webhook body
const items = $input.all();

for (let i = 0; i < items.length; i++) {
  const base64Data = items[i].json.body.attachment;

  if (base64Data && base64Data.includes('base64,')) {
    // 1. Strip the metadata header (e.g., data:image/jpeg;base64,)
    const base64String = base64Data.split(';base64,').pop();

    // 2. Extract the mime type to set the file extension correctly
    const mimeType = base64Data.match(/[^:]\w+\/[\w-+\.]+(?=;base64)/)[0];
    const extension = mimeType.split('/')[1];

    // 3. Convert and create the n8n binary object
    items[i].binary = items[i].binary || {};
    items[i].binary.data = await this.helpers.prepareBinaryData(
      Buffer.from(base64String, 'base64'),
      `bill_upload_${Date.now()}.${extension}`,
      mimeType
    );

    // Optional: Remove the huge base64 string from JSON to keep n8n fast
    delete items[i].json.body.attachment;
  }
}

return items;
